import React, { Component } from "react";
import "./Navi.css";

export default class Navi extends Component {
  render() {
    return (
      <div>
        <div class="navbar">
          <a class="logo" href="#">Trendyol</a>
          <ul class="nav">
            <li><a href="#">Hesabim</a></li>
            <li><a href="#">Favorilerim</a></li>
            <li><a href="#">Sepetim</a></li>
          </ul>
        </div>
      </div>
    );
  }
}
